CREATE TABLE `members` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `name` varchar(255) NOT NULL,
  `name_pinyin` varchar(255) NOT NULL,
  `nickname` varchar(255) DEFAULT NULL,
  `gender` int(11) NOT NULL DEFAULT '0',
  `birthday` datetime DEFAULT NULL,
  `telephone` varchar(255) DEFAULT NULL,
  `mobile` varchar(255) NOT NULL,
  `email` varchar(255) DEFAULT NULL,
  `address` varchar(255) DEFAULT '',
  `job` varchar(255) DEFAULT NULL,
  `cert_type` int(11) NOT NULL,
  `cert_num` varchar(255) NOT NULL,
  `memo` varchar(255) DEFAULT NULL,
  `mentor` varchar(255) DEFAULT NULL,
  `fax` int(11) DEFAULT NULL,
  `description` text,
  `status` int(11) NOT NULL DEFAULT '1',
  `created_at` datetime DEFAULT NULL,
  `updated_at` datetime DEFAULT NULL,
  `is_member` int(11) NOT NULL DEFAULT '1',
  `pinyin_abbr` varchar(255) DEFAULT NULL,
  `standby_phone` varchar(16) NOT NULL DEFAULT '',
  `consume_amount` decimal(10,0) NOT NULL DEFAULT '0',
  `consume_counter` int(11) NOT NULL DEFAULT '0',
